import React from "react";
import "../Navbar/Navbar.scss"
const Navbar = () => {
    let navbarRef = React.useRef();
    function handleRefCall(){
        if(navbarRef.current.style.display === 'fixed') navbarRef.current.style.display = "none";
        else navbarRef.current.style.display = "fixed";
    }
    return <nav ref={navbarRef}>
        <h1>PYQ.Net</h1>
        <ul>
            <li>Home</li>
            <li>LogIn/SignUp</li>
            <li>Contact Us</li>
            <li>User Settings</li>
            <li onClick={() => handleRefCall()}>^</li>
        </ul>
    </nav>
}

export default Navbar;
